selector_to_html = {"a[href=\"#create-rest-api\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Crea REST API<a class=\"headerlink\" href=\"#create-rest-api\" title=\"Link to this heading\">#</a></h2><h3>Breve Descrizione<a class=\"headerlink\" href=\"#brief-description\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#data-rceiving-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato Ricezione Dati<a class=\"headerlink\" href=\"#data-rceiving-format\" title=\"Link to this heading\">#</a></h2><h3>Codice Vocale<a class=\"headerlink\" href=\"#voice-code\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#use-http-protocol-to-transfer-data\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Usa il protocollo HTTP per trasferire i dati<a class=\"headerlink\" href=\"#use-http-protocol-to-transfer-data\" title=\"Link to this heading\">#</a></h1><h2>Crea REST API<a class=\"headerlink\" href=\"#create-rest-api\" title=\"Link to this heading\">#</a></h2><h3>Breve Descrizione<a class=\"headerlink\" href=\"#brief-description\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#set-the-content-type-of-the-scanner-request\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Imposta il tipo di contenuto della richiesta di scanner<a class=\"headerlink\" href=\"#set-the-content-type-of-the-scanner-request\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#request-mode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Richiesta<a class=\"headerlink\" href=\"#request-mode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#return-parameter\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Parametro Ritorno<a class=\"headerlink\" href=\"#return-parameter\" title=\"Link to this heading\">#</a></h3><p>Per maggiori informazioni, vedere <a class=\"reference internal\" href=\"wireless.html#data-rceiving-format\"><span class=\"std std-ref\">Formato di ricezione dei dati</span></a></p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/application-json.png\"><img alt=\"../../media/application-json.png\" src=\"../../media/application-json.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Applicazione/Json</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#set-the-data-format-sent-by-the-scanner\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Imposta il formato dei dati inviato dallo scanner<a class=\"headerlink\" href=\"#set-the-data-format-sent-by-the-scanner\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#request-url\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Richiedi URL<a class=\"headerlink\" href=\"#request-url\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id1\"]": "<div class=\"literal-block-wrapper docutils container\" id=\"id1\">\n<div class=\"code-block-caption\"><span class=\"caption-text\">Richiedi Esempio</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this code\">#</a></div>\n<div class=\"highlight-json notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"linenos\">1</span><span class=\"p\">{</span><span class=\"nt\">\"id\"</span><span class=\"p\">:</span><span class=\"w\"> </span><span class=\"s2\">\"04B9023A\"</span><span class=\"p\">,</span><span class=\"nt\">\"msg\"</span><span class=\"p\">:</span><span class=\"s2\">\"1234567890\"</span><span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/25WFCOMMPM23S1.png\"><img alt=\"../../media/25WFCOMMPM23S1.png\" src=\"../../media/25WFCOMMPM23S1.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Json Format</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#brief-description\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Breve Descrizione<a class=\"headerlink\" href=\"#brief-description\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#request-parameters\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Parametri Di Richiesta<a class=\"headerlink\" href=\"#request-parameters\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#configure-scanner\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura Scanner<a class=\"headerlink\" href=\"#configure-scanner\" title=\"Link to this heading\">#</a></h2><h3>Imposta il tipo di contenuto della richiesta di scanner<a class=\"headerlink\" href=\"#set-the-content-type-of-the-scanner-request\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#configure-wifi-and-api-url-address\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Configura l\u2019indirizzo WiFi e API URL<a class=\"headerlink\" href=\"#configure-wifi-and-api-url-address\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
